import React, { Component } from "react";
import "../App.css";
import logo from "../nasa-logo-web-rgb.png";
import bg from "../backgroundxd.png";
import Navbar from "react-bootstrap/Navbar";
import Container from "react-bootstrap/Container";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";
import Row from "react-bootstrap/Row";

export default class PurdueNavbar extends Component {
  render() {
    return (
      <>
        <div id="container">
          <img src={bg} height="569" className="bg" />

          <Navbar className="haha">
            <Container>
              <Row>
                <Navbar.Brand href="#home">
                  <img
                    alt=""
                    src="https://upload.wikimedia.org/wikipedia/commons/thumb/e/e5/NASA_logo.svg/2449px-NASA_logo.svg.png"
                    width="110"
                    height="100"
                    className="d-inline-block align-top"
                  />
                </Navbar.Brand>
              </Row>
              <Row>
                <Navbar.Collapse id="basic-navbar-nav">
                  <Nav className="me-auto">
                    <Nav.Link href="#home">Link</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>
                    <Nav.Link href="#link">Link</Nav.Link>
                  </Nav>
                </Navbar.Collapse>
              </Row>
            </Container>
          </Navbar>
        </div>
      </>
    );
  }
}
